import React from "react";

import "./checkoutPage.scss";

const CheckoutPage = () => (
  <div>
    <div>
        <div><span>Product</span></div>
        <div><span>Name</span></div>
        <div><span>Quantity</span></div>
        <div><span>Price</span></div>
        <div><span>Remove</span></div>
    </div>
  </div>
);
export default CheckoutPage;
